import { Container, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import "./profile.css";

function ChatBox(){
    return(
        <Box className="chat-box-container">
            <Container style={{backgroundColor:"red"}}>
                <Typography variant="h6" style={{color:"white"}}>Hello World Hello World Hello World Hello World Hello World Hello World Hello World</Typography>
            </Container>
        </Box>
    )
}


export default ChatBox;
